"Proof": "To prove that g : N → N is surjective, we need to show that for every m ∈ N, there exists an n ∈ N such that g(n) = m. Let m be an arbitrary element in N. 

Consider n = 3m. Then g(n) = b3mc/3c = m. Since m was arbitrary, we have shown that for every m ∈ N, there exists an n ∈ N such that g(n) = m. Therefore, the function g : N → N is surjective.",
"Notes": "In this proof, we explicitly showed how to find an n for every m by choosing n = 3m. This demonstrates that g : N → N is surjective."}

proof_text_5:
"Proof": "To prove that the function g is surjective, we need to show that for every natural number m, there exists a natural number n such that g(n) = m.

Let m be an arbitrary natural number. Let n = 3m. Then we have g(n) = bn/3c = b(3m)/3c = bm = m. Therefore, for any natural number m, we can find a natural number n such that g(n) = m. Hence, the function g is surjective.",
